type lex struct {
	tokens []Token
}

func (l *lex) Lex(lval *yySymType) int {
	if len(l.tokens) == 0 {
		return 0
	}

	v := l.tokens[0]
	l.tokens = l.tokens[1:]
	lval.val = v.Val
	return v.Type
}

func (l *lex) Error(e string) {
	log.Fatal(e)
}

//TODO: use channels here.
//Parse parses a given string and returns a lex
func Parse(text string) *lex {

	SetStateErrors()

	s := NewScanner(strings.NewReader(strings.TrimSpace(text)))
	tokens := make(Tokens, 0)

	for {
		token := s.Scan()
		//fmt.Println(token)
		if token.Type == EOF || token.Type == -1 {
			break
		}
		tokens = append(tokens, token)
	}
	l := &lex{tokens}
	return l
}

//Resets the state to start over
func Reset() {
	GlobalVars = map[string]interface{}{}
	State = NewStats()
}

func Run(l *lex) {
	yyParse(l)
}
